import React from "react";
import { useState, useEffect } from "react";
import { useDispatch, useSelector } from 'react-redux';
import { getTemperaments, postBreed } from '../../redux/actions/actions';
import {Link, useHistory} from 'react-router-dom'; 

export default function Creator() {
    const dispatch = useDispatch();
    const history= useHistory();


    const [input, setInput] = useState({   
          id:"",
          name:"",
          height:"", 
          weight:"",
          age: "",
          image:"",
          createInDb:"",
          temperaments:[]
       });
 

    useEffect(() => {
      dispatch(getTemperaments());
    }, []);
    
    const temperaments = useSelector(state => state.temperaments);
    console.log(temperaments);
    
    const [selectedTemperaments, setSelectedTemperaments] = useState([]);
    //Estado que almacena temps seleccionados.
     
    function handleChange(e){
      setInput({
        ...input, 
        [e.target.name]: e.target.value
      });
      console.log(input);    
    }


    function handleSelect(e) {
      const selectedTemperament = e.target.value;
      setInput(prevState => ({
        ...prevState, 
        temperaments: [...prevState.temperaments, selectedTemperament]
      }));
      setSelectedTemperaments([...selectedTemperaments, selectedTemperament]);
    }


          function handleSubmit(e){
          e.preventDefault();
          console.log(input)
          dispatch(postBreed(input)).then((response) => {
            console.log(response);
          });
          alert('Breed created successfully')
          setInput({
            ...input,
          id:"",
          name:"",
          height:"", 
          weight:"",
          age: "",
          image:"",
          createInDb:"",
          temperaments:[]
          }); 
        history.push('/home')
        }
    return (
         <div>
           <h1>Create your own breed!</h1> 
           <form onSubmit={(e) => handleSubmit(e)}>
            <div>
               <label>Breed:</label> 
               <input 
               type="text"
               value= {input.name}
               name="name" 
               onChange={(e) => handleChange(e)}
               />
            </div>
            <div>
                <label>Height:</label>
                <input
                type="number"
                value={input.height}
                name="height"
                onChange={(e) => handleChange(e)}
                />
              </div>
              <div>
                <label>Weight:</label>
                <input
                 type="number"
                 value={input.weight}
                 name="weight"
                 onChange={(e) => handleChange(e)}
                />
              </div>  
              <div>
                <label>Age:</label>
               <input
               type="number"
               value={input.age}
               name="age"
               onChange={(e) => handleChange(e)}
               />
              </div>
              <div>
                <label>Image:</label>
                <input
                 type="text"
                 value={input.image}
                 name="image"
                 onChange={(e) => handleChange(e)}
                />
              </div>          
